import React from 'react';
import * as konva from 'react-konva';

import { toKonvaProps } from './helpers';

const rockB64 = 'data:image/svg+xml;base64,';
const img = new Image();
img.src = rockB64;

const Rock = (props) => {
  const konvaProps = toKonvaProps(props);
  return (
    <konva.Image
      image={img}
      { ...konvaProps }
    />
  );
};

export default Rock;
